B.kU=new A.ac(B.a6_,["\ubb34\ub8cc \ud2b8\ub77c\uc774\uc5bc \uc2e0\uccad\uc744 \ud558\uc2dc\uba74 \uc2a4\ucf00\uc904 \ud655\uc815 \ud6c4 \uce74\ud1a1 \ucc44\ub110\uc744 \ud1b5\ud574 \uc548\ub0b4\ub4dc\ub9bd\ub2c8\ub2e4.\n\n\ud2b8\ub77c\uc774\uc5bc \uc218\uc5c5\uc740 20\ubd84\uac04 \uc9c4\ud589\ub418\uba70 \ub808\ubca8 \ud14c\uc2a4\ud2b8\ub85c \uc9c4\ud589\ub418\uc5b4 \uc815\uaddc \uc218\uc5c5\uacfc \uc218\uc5c5 \ubc29\uc2dd\uacfc\ub294 \ub2e4\ub985\ub2c8\ub2e4.\n\ud2b8\ub77c\uc774\uc5bc \uc2e0\uccad \uc2dc, \uc218\uc5c5 \uac00\ub2a5 \uc2dc\uac04\ub300\ub97c \uc5ec\ub7ec\uac1c \uc8fc\uc2dc\uba74 \ud2b8\ub77c\uc774\uc5bc \uc9c4\ud589\uc774 \uc218\uc6d4\ud558\uaca0\uc2b5\ub2c8\ub2e4!","\ub538\uae30\uc601\uc5b4 \ud68c\uc6d0\uac00\uc785 \ud6c4 \ud648\ud398\uc774\uc9c0 \uc0c1\ub2e8 '\uc218\uac15\uc2e0\uccad'\uc744 \ub204\ub974\uc2dc\uba74 \uc815\uaddc\uc218\uc5c5 \uc2e0\uccad\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n\uc815\uaddc\uc218\uc5c5\uc5d0 \ub300\ud55c \ubb38\uc758\ub294 \uce74\ud1a1 \uc0c1\ub2f4(\uce74\uce74\uc624\ud1a1 \ucc44\ub110: \ub538\uae30\uc601\uc5b4(http://pf.kakao.com/_aSqxeT)\uc73c\ub85c \uc0c1\ub2f4\ubc1b\uc73c\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\uc0c1\ub2f4 \uac00\ub2a5\uc2dc\uac04\uc740 \ud3c9\uc77c \uc624\uc804 9\uc2dc\ubd80\ud130 \uc624\ud6c4 5\uc2dc\uae4c\uc9c0\uc774\uba70, \uc0c1\ub2f4\uc2dc\uac04 \uc678 \uc0c1\ub2f4\uac74\uc740 \ub2e4\uc74c \uc5c5\ubb34\uc2dc\uac04\uc5d0 \uc9c4\ud589\ub429\ub2c8\ub2e4.","\uc218\uac15 \uac00\ub2a5 \uc2dc\uac04\uc740 \uc624\uc804 7\uc2dc 00\ubd84(\ud55c\uad6d\uc2dc\uac04) \ubd80\ud130 \uc624\uc804 12\uc2dc 00\ubd84(\ud55c\uad6d\uc2dc\uac04) \uae4c\uc9c0 \uc218\uc5c5\uc774 \uc9c4\ud589\ub418\uc9c0\ub9cc\n\ud29c\ud130\ubd84\ub4e4\uc5d0 \ub530\ub77c \uc218\uc5c5 \uac00\ub2a5\uc2dc\uac04\uc774 \ub2ec\ub77c\uc9c8 \uc218 \uc788\uaca0\uc2b5\ub2c8\ub2e4.\n\uc624\uc804 \uc218\uc5c5\uc744 \ud558\ub2e4 \uc800\ub141 \uc218\uc5c5\uc73c\ub85c \ubcc0\uacbd \uc2dc, \ud29c\ud130\ubd84\ub3c4 \ubcc0\uacbd \ub420 \uc218 \uc788\ub294 \uc810 \uc591\ud574 \ubd80\ud0c1 \ub4dc\ub9bd\ub2c8\ub2e4.","\uc218\uc5c5 \uc2dc\uc791 *12\uc2dc\uac04 \uc804\uc5d0* \ub9c8\uc774\ud398\uc774\uc9c0\uc5d0\uc11c \ucde8\uc18c \uc2e0\uccad \ud560 \uc218 \uc788\uc73c\uba70 \ucde8\uc18c \uc2e0\uccad \uc2dc \uc790\ub3d9\uc73c\ub85c \uc218\uc5c5 \uc885\ub8cc \uc77c\uc815\uc774 \uc5f0\uae30\ub429\ub2c8\ub2e4.\n\n\ucde8\uc18c \ud69f\uc218 \ubc0f \uc218\uc5c5 \uc911\uc9c0 \uac00\ub2a5 \ud69f\uc218\ub294 \uad6c\ub3c5 \uae30\uac04\uacfc \uc8fc \uc218\uc5c5 \ud69f\uc218\uc5d0 \ub530\ub77c \uc544\ub798\uc640 \uac19\uc2b5\ub2c8\ub2e4.\n\n>>1\uac1c\uc6d4 \uad6c\ub3c5<<\n\uc8fc 2\ud68c \uc218\uc5c5: 2\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0\n\uc8fc 3\ud68c \uc218\uc5c5: 3\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0\n\uc8fc 5\ud68c \uc218\uc5c5: 5\ud68c \uc218\uc5c5 \ucde8\uc18c / 1\ud68c \uc218\uc5c5 \uc911\uc9c0\n\n>>3\uac1c\uc6d4 \uad6c\ub3c5<<\n\uc8fc 2\ud68c \uc218\uc5c5: 5\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0\n\uc8fc 3\ud68c \uc218\uc5c5: 7\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0\n\uc8fc 5\ud68c \uc218\uc5c5: 12\ud68c \uc218\uc5c5 \ucde8\uc18c / 3\ud68c \uc218\uc5c5 \uc911\uc9c0","\uc601\uc218\uc99d\uacfc \uc218\uac15\uc99d, \ucd9c\uc11d\uc99d \ubc1c\uae09\uc774 \uac00\ub2a5\ud569\ub2c8\ub2e4. \uce74\ud1a1\uc0c1\ub2f4\uc73c\ub85c \uc694\uccad\ud574\uc8fc\uc138\uc694.","\ub4dc\ubb3c\uc9c0\ub9cc \ub2f4\ub2f9 \uac15\uc0ac\uc758 \uc2e4\uc218\ub098 \uc778\ud130\ub137 \ubb38\uc81c \ub4f1\uc73c\ub85c \uc774 \uac19\uc740 \uacbd\uc6b0\uac00 \ubc1c\uc0dd\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\ub9cc\uc57d \uc218\uc5c5\uc2dc\uac04\uc774 \ub418\uc5c8\ub294\ub370\ub3c4, \ub2f4\ub2f9\uac15\uc0ac\uc758 \uc5f0\ub77d\uc774 \uc5c6\ub2e4\uba74, \ub418\ub3c4\ub85d \ube68\ub9ac \uce74\ud1a1\uc73c\ub85c \uc5f0\ub77d\uc744 \uc8fc\uc2dc\uae30 \ubc14\ub78d\ub2c8\ub2e4.\n\n\uac15\uc0ac \uce21\uc758 \ucc45\uc784\uc73c\ub85c \ub2f9\uc77c \uc218\uc5c5\uc744 \ubc1b\uc9c0 \ubabb\ud588\uc744 \uacbd\uc6b0, \uc218\uc5c5\uc740 \uc5f0\uae30 \ucc98\ub9ac\uac00 \ub418\uba70 \ubcf4\uc0c1 \uc801\ub9bd\uae08 3000\ud3ec\uc778\ud2b8\uac00 \uc801\ub9bd\ub429\ub2c8\ub2e4.\n\ub9cc\uc57d, \uc0c1\ub2f4\uc2dc\uac04 \uc774\ud6c4 \uc5f0\ub77d\uc744 \uc8fc\uc2dc\uba74 1\uc601\uc5c5\uc77c \uc774\ud6c4 \ub3c4\uc6c0\ub4dc\ub9ac\ub3c4\ub85d \ud558\uaca0\uc2b5\ub2c8\ub2e4.","\ub124, \uc800\ud76c\ub294 \uc218\uc5c5\uc744 \uc704\ud574 \ub2e4\uc591\ud55c \uad50\uc7ac\uac00 \uc0ac\uc6a9 \ub418\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\ud2b8\ub77c\uc774\uc5bc\uc744 \ud1b5\ud574 \ud559\uc0dd\uc758 \ub808\ubca8\uc744 \ud3c9\uac00 \ud55c \ud6c4 \uc694\uccad\ud558\uc2dc\ub294 \ud1a0\ud53d\uc5d0 \ub9de\ucdb0 \uc218\uc5c5 \uad50\uc7ac\ub97c \uc120\uc815\ud558\uc5ec \uc218\uc5c5\uc744 \uc9c4\ud589\ud569\ub2c8\ub2e4.\n\n\uc218\uc5c5 \uad50\uc7ac\ub85c\ub294 \ud29c\ud130\ubd84\uc758 \ud310\ub2e8\uc5d0 \ub530\ub77c \ud559\uc2b5\uad50\uc7ac\uac00 \uc544\ub2cc Article \ud639\uc740 Case Study\ub97c \uac00\uc9c0\uace0 \ud1a0\ub860 \ud615\uc2dd\uc758 \uc218\uc5c5\ub3c4 \ub420 \uc218 \uc788\uaca0\uc2b5\ub2c8\ub2e4.\n\ubb34\uc5c7\ubcf4\ub2e4\ub3c4 \ud559\uc0dd\ubd84\ub4e4\uc758 \uc131\ud5a5\uacfc \uad00\uc2ec\uc0ac\uc5d0 \ub9de\uac8c \ub9de\ucda4\ud615 \uc9c4\ud589\uc744 \uc9c0\ud5a5\ud558\uace0 \uc788\uae30\uc5d0 \uc18c\ud1b5\uc744 \ud1b5\ud574 \uc218\uc5c5 \ubc29\uc2dd\uc744 \ub9de\ucdb0\uac08 \uc218 \uc788\uaca0\uc2b5\ub2c8\ub2e4.","\ud0c0\uc0ac \ub300\ube44 \ub192\uc740 \uc784\uae08\uacfc \uadfc\ubb34 \uc5ec\uac74\uc744 \ubcf4\uc7a5\ud558\uba70 \uc218 \ub9ce\uc740 \uc9c0\uc6d0\uc790\ub4e4 \uc911 \ucd5c\uace0\uc758 \ud29c\ud130\ub9cc\uc744 \ubf51\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n3\ucc28 \uc2a4\ud06c\ub9ac\ub2dd\uc5d0 \uac78\uccd0 \uae4c\ub2e4\ub86d\uac8c \ucc44\uc6a9\uc744 \ud558\uae30\uc5d0 \ub538\uae30\uc601\uc5b4 \ud29c\ud130\ubd84\ub4e4\uc744 \ub9cc\ub098 \ubcf4\uc2e0\ub2e4\uba74 \ud544\ub9ac\ud540 \ud29c\ud130\uc5d0 \ub300\ud55c \uace0\uc815\uad00\ub150\uc774 \uae68\uc9c0\uac8c \ub420 \uac83\uc785\ub2c8\ub2e4 :)","\ub538\uae30\uc601\uc5b4\ub294 \ucd5c\uace0\uc758 \ud29c\ud130\ubd84\ub4e4\uc744 \ubf51\uae30 \uc704\ud574 \ub192\uc740 \uc784\uae08\uc744 \ubcf4\uc7a5\ud568\uc5d0\ub3c4 \ubd88\uad6c\ud558\uace0 \uc774\ub807\uac8c \uc800\ub834\ud558\uac8c \uc218\uc5c5\uc744 \uc81c\uacf5\ud560 \uc218 \uc788\ub294 \uc774\uc720\ub294\n\ubd88\ud544\uc694\ud55c \uace0\uc815\ube44\uc640 \ub9c8\ucf00\ud305\ube44\ub97c \ucca0\uc800\ud558\uac8c \uc81c\ud55c\ud558\uc5ec \uac70\ud488\uc744 \ube90\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4.\n\n\uc774\ub294 \ucc3d\uc5c5\uc804 \ud0c0\uc0ac \uc804\ud654 \uc601\uc5b4\ub97c \uacbd\ud5d8\ud558\uba70 \ud29c\ud130\ubd84\ub4e4\uc758 \uc2e4\ub825\uc774 \ucc9c\ucc28\ub9cc\ubcc4\uc778 \uac83\uacfc \uadf8\uc5d0 \ube44\ud574 \uc218\uc5c5\ube44\uac00 \ub108\ubb34 \ube44\uc2f8 \ubd80\ub2f4\uc744 \ub290\uaf08\ub358 \uacbd\ud5d8 \ub54c\ubb38\uc5d0\n\uc88b\uc740 \uc218\uc5c5\uc744 \uc800\ub834\ud55c \uac00\uaca9\uc5d0 \uc81c\uacf5\ud558\uc790\ub294 \uc758\uc9c0\uc5d0\uc11c \ub9c8\uc9c4\uc744 \ucd5c\uc18c\ud654 \ud558\uc5ec \uac00\uaca9\uc744 \uacb0\uc815\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.\n\n\uc0ac\uc2e4 \uc0ac\uc5c5\uc774 \ucc98\uc74c\uc774\ub77c \uc6b4\uc601\uc9c4 \uc778\uac74\ube44\ub098 \ubd80\uac00\uc138, \uc18c\ub4dd\uc138 \ub4f1\uacfc \uac19\uc740 \uc138\uae08\uc744 \uace0\ub824\ud558\uc9c0 \ubabb\ud574 \uc5b4\ub824\uc6c0\uc774 \uc788\uc9c0\ub9cc\n\uc774 \uc5ed\uc2dc\ub3c4 \ub9ce\uc740 \ubd84\ub4e4\uc774 \ub538\uae30\uc601\uc5b4\ub97c \uc774\uc6a9\ud558\uba74 \ud574\uacb0 \ub420 \ubb38\uc81c\ub77c\uace0 \ubbff\uc73c\uba70 \uc800\ub834\ud55c \uac00\uaca9\uc744 \uace0\uc218\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4!","\ub538\uae30\uc601\uc5b4 \uc218\uac15\ub8cc \uacb0\uc81c\ub294 \uacc4\uc88c\uc774\uccb4\ub9cc \uac00\ub2a5\ud569\ub2c8\ub2e4.\n\n\uc0ac\uc5c5\uc790\uc758 \uacbd\uc6b0 \uc138\uae08\uacc4\uc0b0\uc11c/\uc9c0\ucd9c\uc99d\ube59 \ud604\uae08\uc601\uc218\uc99d, \uac1c\uc778\uc758 \uacbd\uc6b0 \uc18c\ub4dd\uacf5\uc81c\uc6a9 \ud604\uae08\uc601\uc218\uc99d\uc744 \ubc1c\uae09\ubc1b\uc73c\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n\ub538\uae30\uc601\uc5b4\ub294 \ubaa8\ub4e0 \uc785\uae08\uac74\uc5d0 \ub300\ud574 \ud604\uae08\uc601\uc218\uc99d\uc744 \ubc1c\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n\n1) \ud604\uae08\uc601\uc218\uc99d \ubc1c\uae09\ubc29\ubc95\n\n  \ud604\uae08\uc601\uc218\uc99d\uc740 \ub9c8\uc774\ud398\uc774\uc9c0-\ub0b4 \uc218\uac15\uc815\ubcf4-\ud604\uae08\uc601\uc218\uc99d \uce78\uc5d0 \uc785\ub825\ud574\uc8fc\uc2dc\ub294 \ubc88\ud638\ub85c \ubc1c\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n  \ud604\uae08\uc601\uc218\uc99d \ubc88\ud638\ub97c \uae30\uc7ac\ud574\uc8fc\uc9c0 \uc54a\uc73c\uc2dc\ub294 \uacbd\uc6b0 \uad6d\uc138\uccad \ubc88\ud638\ub85c \ubc1c\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n  \ud604\uae08\uc601\uc218\uc99d \ubc1c\ud589 \uc2dc \ubcc4\ub3c4\uc758 \uc774\uba54\uc77c\uc774 \ubc1c\uc1a1\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n  \uc774\uba54\uc77c\ub85c \ubc1b\uace0\uc790 \ud558\uc2dc\ub294 \uacbd\uc6b0 \uce74\ud1a1 \uc0c1\ub2f4\uc73c\ub85c \uc2e0\uccad\ud574\uc8fc\uc138\uc694.\n\n2) \uc138\uae08\uacc4\uc0b0\uc11c \ubc1c\uae09\ubc29\ubc95\n\n  \uc138\uae08\uacc4\uc0b0\uc11c\ub294 \uce74\ud1a1\uc0c1\ub2f4\uc73c\ub85c \uc2e0\uccad\ud574 \uc8fc\uc2dc\uba74 \ubc1c\uae09\ubc1b\uc73c\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n  \uc0ac\uc5c5\uc790\ub4f1\ub85d\uc99d \ucea1\ucc98\ubcf8\uacfc \uae30\ud0c0 \ube44\uace0\uc0ac\ud56d\uc744 \uce74\ud1a1\uc0c1\ub2f4\uc744 \ud1b5\ud574 \ubcf4\ub0b4\uc8fc\uc2dc\uba74 5\uc601\uc5c5\uc77c \uc774\ub0b4\ub85c \ubc1c\ud589\ud574\ub4dc\ub9bd\ub2c8\ub2e4.","1) \ud604\uae08\uc601\uc218\uc99d \ubc1c\uae09\ubc29\ubc95\n\n  \ud604\uae08\uc601\uc218\uc99d\uc740 \ub9c8\uc774\ud398\uc774\uc9c0-\ub0b4 \uc218\uac15\uc815\ubcf4-\ud604\uae08\uc601\uc218\uc99d \uce78\uc5d0 \uc785\ub825\ud574\uc8fc\uc2dc\ub294 \ubc88\ud638\ub85c \ubc1c\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n  \ud604\uae08\uc601\uc218\uc99d \ubc88\ud638\ub97c \uae30\uc7ac\ud574\uc8fc\uc9c0 \uc54a\uc73c\uc2dc\ub294 \uacbd\uc6b0 \uad6d\uc138\uccad \ubc88\ud638\ub85c \ubc1c\ud589\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.\n  \ud604\uae08\uc601\uc218\uc99d \ubc1c\ud589 \uc2dc \ubcc4\ub3c4\uc758 \uc774\uba54\uc77c\uc774 \ubc1c\uc1a1\ub418\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n  \uc774\uba54\uc77c\ub85c \ubc1b\uace0\uc790 \ud558\uc2dc\ub294 \uacbd\uc6b0 \uce74\ud1a1 \uc0c1\ub2f4\uc73c\ub85c \uc2e0\uccad\ud574\uc8fc\uc138\uc694.\n\n2) \uc138\uae08\uacc4\uc0b0\uc11c \ubc1c\uae09\ubc29\ubc95\n\n  \uc138\uae08\uacc4\uc0b0\uc11c\ub294 \uce74\ud1a1\uc0c1\ub2f4\uc73c\ub85c \uc2e0\uccad\ud574 \uc8fc\uc2dc\uba74 \ubc1c\uae09\ubc1b\uc73c\uc2e4 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n  \uc0ac\uc5c5\uc790\ub4f1\ub85d\uc99d \ucea1\ucc98\ubcf8\uacfc \uae30\ud0c0 \ube44\uace0\uc0ac\ud56d\uc744 \uce74\ud1a1\uc0c1\ub2f4\uc744 \ud1b5\ud574 \ubcf4\ub0b4\uc8fc\uc2dc\uba74 5\uc601\uc5c5\uc77c \uc774\ub0b4\ub85c \ubc1c\ud589\ud574\ub4dc\ub9bd\ub2c8\ub2e4.","\uc801\ub9bd\uae08\uc740 \ub2e4\uc74c \uc218\uac15\ub8cc \uacb0\uc81c \uc2dc \uc0ac\uc6a9 \ud560 \uc218 \uc788\uc73c\uba70, \uc0ac\uc6a9\ud55c \uc801\ub9bd\uae08 \ub9cc\ud07c \uc218\uac15\ub8cc \ud560\uc778\uc774 \uc801\uc6a9\ub429\ub2c8\ub2e4.\n\n\uc801\ub9bd\uae08 \uc0ac\uc6a9\uc744 \uc6d0\ud558\ub294 \uacbd\uc6b0, \uc218\uc5c5 \uc5f0\uc7a5 \uc548\ub0b4 \uc2dc \uc0ac\uc6a9 \uc5ec\ubd80\ub97c \ub9d0\ud574\uc8fc\uc2dc\uba74 \ub429\ub2c8\ub2e4.\n(\uc801\ub9bd\uae08 \uc0ac\uc6a9 \uc720\ud6a8\uae30\uac04\uc740 \uc801\ub9bd \uc0ac\uc720 \ubc1c\uc0dd\uc77c\ub85c\ubd80\ud130 1\ub144\uc785\ub2c8\ub2e4.)","\ub538\uae30\uc601\uc5b4\ub294 \ubaa8\ub4e0 \uc218\uc5c5\uc744 \ub179\ud654\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. \uc218\uc5c5\uc774 \uc885\ub8cc \ub41c \uc774\ud6c4 \ub179\ud654\ub41c \uc601\uc0c1\uc774 \uc804\ub2ec \ub418\uc5b4\uc9d1\ub2c8\ub2e4.","\ub538\uae30\uc601\uc5b4\ub294 \ud559\uc0dd\ubd84\ub4e4\uc758 \uc218\uc5c5 \ub9cc\uc871\ub3c4\ub97c \ucd5c\uc6b0\uc120\uc73c\ub85c \uc0dd\uac01\ud569\ub2c8\ub2e4!\n\n\ud29c\ud130\ubd84 \ubcc0\uacbd\uc744 \uc6d0\ud558\uc2e0\ub2e4\uba74 \uce74\uce74\uc624\ud1a1 \ucc44\ub110\uc744 \ud1b5\ud574 \ub9d0\uc500\ud574 \uc8fc\uc2dc\uba74 \ub3c4\uc6c0\ub4dc\ub9ac\ub3c4\ub85d \ud558\uaca0\uc2b5\ub2c8\ub2e4.\n\uc2dc\uac04\uc774 \ub2e4\uc18c \uc18c\uc694\ub420 \uc218 \uc788\uc9c0\ub9cc \ud559\uc0dd\ubd84\uacfc \uc798 \ub9de\ub294 \ud29c\ud130\ubd84\uacfc \ub9e4\uce6d \ub420 \ub54c\uae4c\uc9c0 \ud29c\ud130 \ubcc0\uacbd\uc774 \uac00\ub2a5\ud558\uaca0\uc2b5\ub2c8\ub2e4.\n\n\ub2e4\uc74c \uc218\uc5c5 \uc2dc\uc791\ud558\uae30 12\uc2dc\uac04 \uc804\uae4c\uc9c0\ub9cc \uc218\uc5c5 \uc5f0\uae30\ub098 \ubcc0\uacbd\uc774 \uac00\ub2a5\ud558\uae30 \ub54c\ubb38\uc5d0 \uadf8 \ubd80\ubd84\ub9cc \uc720\uc758\ud574 \uc8fc\uc2dc\uba74 \ub418\uaca0\uc2b5\ub2c8\ub2e4.\n\ub9cc\uc57d, \ud29c\ud130\ubd84\uc740 \uc88b\uc9c0\ub9cc \uc218\uc5c5 \ubc29\uc2dd\uc744 \ubc14\uafb8\uace0 \uc2f6\ub2e4\uba74 \uce74\ud1a1 \ucc44\ub110\ub85c \uc5f0\ub77d\uc744 \uc8fc\uc154\uc11c \uc694\uccad \uc8fc\uc2dc\uba74 \uc218\uc5c5 \ubc29\uc2dd\uc774 \ubcc0\uacbd \ub420 \uc218 \uc788\ub3c4\ub85d \uc870\uc728 \ud558\uaca0\uc2b5\ub2c8\ub2e4 \ud83d\ude42"],t.w)
